import React, {useState, useEffect} from 'react';
import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const [data, setData] = useState([{}]);
    var letter = ""

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                // console.log(data)
            }
        )  
    }, [])

    const diagnose=()=> {

    }

    function if_stat(word) {
        <h3>{word[0][0]}</h3>;
        letter=word[0][0];
        <Togglebutton name={word} category_same={false} />
    }


    return (
        <div className='Diagnose-page'>
            <h1>Select Symptoms: </h1>

            {(typeof data === "undefined") ? (
                <p> Loading...</p>
            ) : (

                data.map((item, i) => (

                    <div>
                        {(letter!==item[0][0]) ? if_stat(item) : <Togglebutton name={item} category_same={true} />}

                    </div>
                ))
            )}

            <button onClick={diagnose}>Done</button>
        </div>
    );
}

export default Diagnose;
